import React, {Component} from 'react';
class Project  extends Component{
    render(){
        return(
            <div>
                <h2>Projects</h2>
                <h3>Leaf Disease Identification System</h3>
                <p>Android based application to detect leaf diseases of wheat plants.
                    Uploads results to firebase cloud.
                </p>
            </div>
        );
    }
}
export default Project;
